import * as React from 'react';
import Grid from '@mui/material/Grid';
import {Box, Button, TextField, Typography} from '@mui/material';
import CheckCircleRoundedIcon from '@mui/icons-material/CheckCircleRounded';
import {useState} from 'react';
// @ts-ignore
import {generateToken, validateToken} from "../../services/services.ts";
import { IMaskInput } from 'react-imask';
import '../../styles/components.css';






export const MainPage =()=>{
  const [validateInputValue, setValidateInputValue] = useState<String>(null)
  const [generateInputValue, setGenerateInputValue] = useState<String>(null)

  const [tokenValidation, setTokenValidation] = useState<String>(null)
  const [tokenGeneration, setTokenGeneration] = useState<String>(null)

  const getTokenValidation = async () => {
    console.log(validateInputValue)
    const isValid = await validateToken(validateInputValue);
    setTokenValidation(isValid ? 'Your token is valid!' : 'Your token is not valid...');
  };

  const getGeneratedToken = async () => {
    const token = await generateToken(generateInputValue);
    setTokenGeneration(token);
  };


  return(
    <Grid container
      sx={{ backgroundColor:'secondary.main', height:'100vh', width:'100vw', justifyContent:'center', alignItems:'center'}}>
      <Grid item container xs={12} justifyContent={'center'}  >

      <Grid item container xs={6} justifyContent={'center'} key={'generate'} >
        <Grid item container xs={12} justifyContent={'center'} >
          <Typography variant={'h1'} >
            {'Generate Token'}
          </Typography>
        </Grid>
        <Grid item container xs={12} justifyContent={'center'} sx={{marginTop:'10px'}} >
          <Box maxWidth="400px" sx={{display: 'flex', alignItems: 'center',}}>
            <Typography variant={'h2'} >
              {'This section allows you to create a new token based on your chosen digits. Customize the available digits and click "Generate" to create a token.'}
            </Typography>
          </Box>
        </Grid>
        <Grid item container xs={12} justifyContent={'center'} marginTop={'50px'}  >
          <IMaskInput
              class={'custom-input'}
              mask="0-0-0-0-0-0-0-0-0"
              definitions={{
                '#': /[1-9]/,
              }}
              placeholder="0-0-0-0-0.."
              overwrite
              onAccept={(value, mask) => {
                const unmaskedValue = mask.unmaskedValue; // Retrieve unmasked value
                setGenerateInputValue(unmaskedValue);
                setTokenGeneration(null)
              }}
          />
        </Grid>

        <Grid item container xs={12} justifyContent={'center'} marginTop={'50px'}  >
          <Box
              sx={{
                width: '400px',
                backgroundColor: '#0a253c',
                height: '50px',
                borderRadius: '4px',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center'
              }}
          >
            {(!tokenGeneration || generateInputValue?.length<1) ? (
                <Typography variant="h2">{tokenGeneration}</Typography>

            ) : (
                <Typography variant="h2">{tokenGeneration}</Typography>
            )}
          </Box>

        </Grid>


          <Grid item container xs={12} justifyContent={'center'} marginTop={'30px'} >
            <Button variant="contained" disabled={generateInputValue? generateInputValue.length<1:true} onClick={()=> getGeneratedToken()} >Generate</Button>
        </Grid>
      </Grid>

        <Grid item container xs={6} justifyContent={'center'} key={'validate'}  >
          <Grid item container xs={12} justifyContent={'center'} >
            <Typography variant={'h1'} textAlign={'center'}>
              {'Validate Token'}
            </Typography>
          </Grid>
          <Grid item container xs={12} justifyContent={'center'} sx={{marginTop:'10px'}} >
            <Box maxWidth="400px">
              <Typography variant={'h2'} sx={{ textAlign: 'center' }}>
                {'Use this section to check the validity of a token using the Luhn algorithm. Enter the token and click "Validate" to see if it\'s a valid token.'}
              </Typography>
            </Box>
          </Grid>
          <Grid item container xs={12} justifyContent={'center'} marginTop={'50px'}  >
            <IMaskInput
                class={'custom-input'}
                mask="0000-0000-0000-0000"
                definitions={{
                  '#': /[1-9]/,
                }}
                placeholder="0000-0000-0000-0000"
                overwrite
                onAccept={(value, mask) => {
                  const unmaskedValue = mask.unmaskedValue; // Retrieve unmasked value
                  setValidateInputValue(unmaskedValue);
                  setTokenValidation(null)
                }}
            />
          </Grid>
          <Grid item container xs={12} justifyContent={'center'} marginTop={'50px'}  >
            <Box
                sx={{
                  width: '400px',
                  backgroundColor: '#0a253c',
                  height: '50px',
                  borderRadius: '4px',
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center'
                }}
            >
              {(!tokenValidation || validateInputValue?.length<16) ? (
                    <Typography variant="h2">Input Token to Validate</Typography>

              ) : (
                  <Typography variant="h2">{tokenValidation}</Typography>
              )}
            </Box>

          </Grid>

          <Grid item container xs={12} justifyContent={'center'} marginTop={'30px'} >
            <Button variant="contained" disabled={validateInputValue? validateInputValue.length<16:true} onClick={()=> getTokenValidation()} >Validate</Button>
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
 }
